CREATE SCHEMA IF NOT EXISTS ordnance_survey;

DROP TABLE IF EXISTS ordnance_survey.addressbase_holding;

CREATE TABLE ordnance_survey.addressbase_holding (
  uprn bigint NOT NULL, -- Unique Property Reference Number (UPRN) assigned by the LLPG Custodian or Ordnance Survey
  hash_sum text, -- Hash representing column data
  udprn integer, -- Royal Mail's Unique Delivery Point Reference Number (UDPRN)
  state text, -- A code identifying the current state of the property. Source: Contributing Local Authority
  state_date timestamp with time zone, -- Date on which the property achieved its current state in the real world. Source: Contributing Local Authority
  class text NOT NULL, -- Classification of the address record. Source: Contributing Local Authority
  parent_uprn bigint, -- UPRN of the parent record if a parent child relationship exists. Source: Contributing Local Authority
  x numeric(10,2), -- A value in metres defining the eastings location in accordance to the British National Grid. Source: Ordnance Survey
  y numeric(11,2), -- A value in metres defining the northings location in accordance to the British National Grid. Source: Ordnance Survey
  longitude numeric(16,8), -- A value defining the Longitude location in accordance with the ETRS89 coordinate reference system. Source: Ordnance Survey
  latitude numeric(17,8), -- A value defining the Latitude in accordance with the ETRS89 coordinate reference system. Source: Ordnance Survey
  rpc integer NOT NULL, -- Representative Point Code. This code is used to reflect positional accuracy. Source: Contributing Local Authority
  local_custodian_code integer NOT NULL, -- Unique identifier of the LLPG Custodian
  country text NOT NULL, -- The country in which a record can be found
  la_start_date timestamp with time zone NOT NULL, -- The date on which the address record was inserted into the database. Source: Contributing Local Authority
  last_update_date timestamp with time zone NOT NULL, -- The date on which any of the attributes on this record was last changed
  entry_date timestamp with time zone NOT NULL, -- The date on which this record was inserted into the Local Authority database
  rm_organisation_name text, -- The organisation name is the business name given to a delivery point within a building or small group of buildings. For example: TOURIST INFORMATION CENTRE. This field could also include entries for churches, public houses, and libraries. Source: Royal Mail
  la_organisation text, -- Name of current occupier as provided by the Local Authority Custodian
  department_name text, -- For some organisations, department name is indicated because mail is received by subdivisions of the main organisation at distinct delivery point. For example: Organisation name is ABC COMMUNICATIONS but RM Department Name is MARKETING DEPARTMENT. Source: Royal Mail
  legal_name text, -- Registered legal name of the organisation. Source: Contributing Local Authority
  sub_building_name text, -- The sub-building name and/or number are identifiers for subdivisions of properties. For example: Sub-building Name is FLAT 3, Building name is POPLAR COURT, Thoroughfare is LONDON ROAD. NOTE: If the address is styled 3 POPLAR COURT all the text will be shown in the building name attribute and the sub-building name will be empty. The building number will be shown in this field when it contains a range, decimal, or non-numeric character (see Building Number). Source: Royal Mail
  building_name text, -- The building name is a description applied to a single building or small group of buildings, such as Highfield House. This also includes those building numbers that contain non-numeric digits, such as 44A. Some descriptive names, when included with the rest of the address, are sufficient to identify the property uniquely and unambiguously, for example, MAGISTRATES COURT. Sometimes the building name will be a blend of distinctive and descriptive naming, for example: RAILWAY TARVERN (PUBLIC HOUSE) or THE COURT ROYAL (HOTEL). Source: Royal Mail
  building_number integer, -- The building number is a number given to a single building or small group of buildings, thus identifying it from its neighbours, for example, 44. Buildings numbers that contain a range, decimals, or non-numeric characters do not appear in this field but will be found in the buildingName or sub-BuildingName fields. Source: Royal Mail
  sao_start_number integer, -- The number of secondary addressable object (SAO), or the start of the number range. Source: Contributing Local Authority
  sao_start_suffix text, -- The suffix to the SAO_START_NUMBER. Source: Contributing Local Authority
  sao_end_number integer, -- The end of the number range for the SAO where SAO_START_NUMBER contains the start of the range. Source: Contributing Local Authority
  sao_end_suffix text, -- The suffix to the SAO_END_SUFFIX. Source: Contributing Local Authority
  sao_text text, -- Describes the SAO, such as Maisonette. Source: Contributing Local Authority
  alt_language_sao_text text, -- Describes the SAO, such as Maisonette, in an alternative language (defined by the language code). Source: Contributing Local Authority
  pao_start_number integer, -- The number of the primary accessible object (PAO) or the start of the number range. Source: Contributing Local Authority
  pao_start_suffix text, -- The suffix to the PAO_START_NUMBER. Source: Contributing Local Authority
  pao_end_number integer, -- The end of the number range for the PAO where PAO_START_NUMBER contains the start of the range. Source: Contributing Local Authority
  pao_end_suffix text, -- The suffix to the pao_end_number. Source: Contributing Local Authority
  pao_text text, -- Name describing the PAO, such as Sunrise Towers, in an alternative language. Source: Contributing Local Authority
  alt_language_pao_text text, -- Name describing the PAO, such as Sunrise Towers, in an alternative language. Source: Contributing Local Authority
  usrn integer NOT NULL, -- Unique Street Reference Number. Source: Contributing Local Authority
  usrn_match_indicator integer NOT NULL, -- This field indicates how the item was matched to a USRN. 1 is matched manually to the most accessible USRN and 2 is matched spatially to the nearest USRN that may not be the nearest accessible street. Source: Contributing Local Authority/Ordnance Survey
  area_name text, -- Third level of geographic area name, for example, to record island names or property groups such as crofts. Source: Contributing Local Authority
  level text, -- Memorandum of the vertical position of the property. Source: Contributing Local Authority
  official_flag text, -- Status of the address. Source: Contributing Local Authority
  os_address_toid text, -- Unique identifier provided by Ordnance Survey
  os_address_toid_version integer, -- The version of the OS Address TOID that the product relates to. Source: Ordnance Survey
  os_road_link_toid text, -- The OS MasterMap Integrated Transport Network (ITN) road link that the addressable object refers to. Source: Ordnance Survey
  os_road_link_toid_version integer, -- The version of the OS Road Link TOID the product relates to
  os_topo_toid text, -- The OS MasterMap Topography Layer TOID that the addressable object refers to
  os_topo_toid_version integer, -- The version of the OS Topo TOID the product relates to
  voa_ct_record bigint, -- The unique reference to the Valuation Office Agency (VOA) council tax record which the addressable object refers to
  voa_ndr_record bigint, -- The unique reference to the VOA non-domestic rate which the addressable object refers to
  street_description text NOT NULL, -- Name taken from the Local Land and Property Gazetteer (LLPG) street name
  alt_language_street_description text, -- Name taken from the LLPG street name in an alternative language
  dependent_thoroughfare text, -- In certain places, for example, town centres, there are name thoroughfares within other name thoroughfares, for example, parades of shops on a high street where different parades have their own identity. For example, KINGS PARADE, HIGH STREET, and QUEENS PARADE, HIGH STREET. Source: Royal Mail
  thoroughfare text, -- A thoroughfare in AddressBase is fundamentally a road, track, or named access route on which there are Royal Mail delivery points, for example, HIGH STREET. Source: Royal Mail
  welsh_dependent_thoroughfare text, -- The Welsh translation of DEPENDENT_THOROUGHFARE. Source: Royal Mail
  welsh_thoroughfare text, -- The Welsh translation of THOROUGHFARE. Source: Royal Mail
  double_dependent_locality text, -- This is used to distinguish between similar thoroughfares or the same thoroughfare within a dependent locality. For example, Millbrook Industrial Esate and Cranford Estate in this situation: BRUNEL WAY, MILLBROOK INDUSTRIAL ESTATE, MILLBROOK SOUTHAMPTON and BRUNEL WAY, CRANFORD ESTATE, MILLBROOK, SOUTHAMPTON. Source: Royal Mail
  dependent_locality text, -- Dependent locality areas define an area within a post town. These are only necessary for postal purposes and are used to aid differentiation where there are thoroughfares of the same name in the same locality. For example, HIGH STREET in SHIRLEY and SWAYTHLING in this situation: HIGH STREET, SHIRLEY, SOUTHAMPTON and HIGH STREET, SWAYTHLING, SOUTHAMPTON. Source: Royal Mail
  locality text, -- A locality defines an area of geographical identifier within a town, village or hamlet. Source: Contributing Local Authority
  welsh_dependent_locality text, -- The Welsh translation of DEPENDENT_LOCALITY. Source: Royal Mail
  welsh_double_dependent_locality text, -- The Welsh translation of Double Dependent Locality. Source: Royal Mail
  town_name text, -- The name of the town the address is within. Source: Contributing Local Authority
  administrative_area text NOT NULL, -- Local Highway Authority Name. Source: Contributing Local Authority
  post_town text, -- The town or city in which the Royal Mail sorting office is located which services this record. There may be more than one, possibly several, sorting offices in a town or city
  welsh_post_town text, -- The Welsh translation of post town value. Source: Royal Mail
  postcode text, -- A postcode is an abbreviated form of address made up of combinations of between five and seven alphanumeric characters. These are used by Royal Mail to help with the automated sorting of mail. A postcode may cover between 1 and 100 addresses. There are two main components of a postcode, for example, NW6 4DP: The outward code(or 'outcode'). The first two-four characters of the postcode constituting the postcode area and the postcode district, for example NW6. It is the part of the postcode that enables mail to be sent from the accepting office to the correct area for delivery. The inward code (or 'incode'). The last three characters of the postcode constituting the postcode sector and the postcode unit, for example 4DP. It is used to sort mail at the local delivery office. Source: Royal Mail
  postcode_locator text NOT NULL, -- This field contains the Royal Mail Postcode Address File (PAF) postcode where the local authority address has been matched to PAF, i.e. the POSTCODE field. Where a match has not been made, the postcode information is sourced from the local authority in collaboration with Royal Mail. Where the local authority do not hold a valid postcode Code-Point with Polygons is used to spatially derive the postcode based on the position of the coordinates. This field must be used in conjunction with the RPC field to determine the accuracy of its position. Source: Royal Mail, Contributing Local Authority, or Ordnance Survey
  postcode_type text, -- Describes the address as a small or large user as defined by Royal Mail
  delivery_point_suffix text, -- A two character code uniquely identifying an individual delivery point within a postcode. Source: Royal Mail
  addressbase_portal text, -- Identifies addresses which are believed to be capable of receiving mail as defined specifically for the AddressBase product, and details their relationship with other AddressBase Postal records. N.B. this field identifies some addresses which the AddressBase product believes to be capable of receiving mail which are not contained within the Royal Mail PAF database, such as flats behind a door which has a single letter box
  po_box_number text, -- Post Office Box (PO Box) number. Source: Royal Mail
  ward_code text, -- The ONS GSS code of the electoral ward (England and Scotland) or the electoral division (Wales) name in which the property is situated, as assigned spatially from the latest Boundary-Line set. Boundary-Line ward boundary areas are produced directly from Statutory Instruments, which are authorised from the owning boundary changing bodies; namely the Local Government and Parliamentary Boundary Commissions
  parish_code text, -- The ONS GSS code of the parish, town or community in which the property is situated, as assigned spatially from the latest Boundary-Line set. Boundary-Line parish boundaries are produced directly from Statutory Instruments, which are authorised from the owning boundary changing bodies; namely The Local Government and Parliamentary Boundary Commissions
  rm_start_date timestamp with time zone, -- Date on which the Royal Mail address was loaded into the NAG (National Address Gazetteer - as maintained by Geoplace) hub. Source: Royal Mail
  multi_occ_count integer, -- This is a count of all the child UPRN's for this record if a parent-child relationship exists. Source: Ordnance Survey
  voa_ndrp_desc_code text, -- VOA Non-domestic rates primary description code, for example, IF2. The first letter is the primary category: C=commercial, E=education, F=formula-assessed utility, I=industrial, L=leisure, M=miscellaneous, N=non-formula-assessed utility, T=treasury(crown). The second letter provides further detail, for example: O=office, F=factory. The third and fourth digit is optional and occurs where further subdivision is required, for example, IF1=mill, IF2=works, IF3=workshop, IF4=business unit. Source: Valuation Office Agency
  voa_ndr_scat_code text, -- VOA non-domestic rates special category code, for example, 016. While the primary description code above provides a general level of classification, there is a SCat code for every kind of premise that VOA rates. For example, within PDesc IF2 (industrial/factory/works) there are 009 (aluminium works), 016 (artificial fibre works), 052 (cement works), 055 (chemical works), 110 (foundries), 142 (iron/steel works), 192 (motor vehicle works), and 198 (newspaper printing works). Source: Valuation Office Agency
  alt_language text, -- Field describing the language of the alternative records
  _created timestamp with time zone NOT NULL DEFAULT now(), -- Timestamp for when this record was created
  _created_by text, -- UserID that created this record (if known)
  _modified timestamp with time zone NOT NULL DEFAULT now(), -- Timestamp for when this record was last updated
  _modified_by text, -- UserID that last modified this record (if known)
  CONSTRAINT addressbase_holding_pkey PRIMARY KEY (uprn)
);

